        <div>
            <commentLoader name={'hii'} />
        { commentLoader(array[0])}
        {commentLoader(array[1])}
        {commentLoader(array[2])}

        </div>
    );
}

ReactDOM.render(
    <App />,
    document.querySelector('#root')
